webpackJsonp([0xc5b391f72577],{6339:function(t,e){t.exports={data:{post:{html:'<p>Mama\'s coming back tonight from a 3-day business meeting in Munich. Father and son will be both happy to see her. I, for one, will trying apply what Lyssa said about <a title="Lyssas Lounge - Die Kunst des Kompliments" href="http://lyssaslounge.diaryland.com/030823_15.html">women and compliments</a>. After so many years of marriage, however, it\'s hard to come up with new ones, and the easy thing to do is to take things for granted and just not bother. And I\'ve certainly been guilty of that. So, Mama, you are <a title="Read Lyssa for explanation" href="http://lyssaslounge.diaryland.com/030823_15.html">rock and roll</a>. </p>\n<p>Except that in a personal relationship, I don\'t suppose that compliments given via a public weblog really count.</p>',fields:{title:"Compliments",date:"27 Aug 2003",url:"https://papascott.de/2003-08-27-compliments/"}}},pathContext:{slug:"/2003-08-27-compliments/",prev:{fields:{title:"stimate of 2004 US budget deficit: $480 billion",date:"26 Aug 2003",slug:"/2003-08-26-stimate-of-2004-us-budget-deficit-480-billion/"}},next:{fields:{title:"Private Lynch honorably discharged, so she's now free to tell/sell her story.",date:"28 Aug 2003",slug:"/2003-08-28-private-lynch-honorably-discharged-so-shes-now-free-to-tellsell-her-story/"}}}}}});
